g2:c.PROCEDURE.g2:a.TEXT:
g2-java-socket-read-it(Socket: class g2-java-socket)

ReadFile: class g2-stream;
Data: text = "";
DataInt: integer;
DataSeq: sequence = sequence ();

Begin

    ReadFile = call g2-open-file-for-read(test-file);
    repeat
        allow other processing;
        exit if the g2-stream-status of ReadFile is end-of-file-reached; 
        DataInt = call g2-read-byte (ReadFile);
        if DataInt > 0 then
            DataSeq = insert-at-end(DataSeq, DataInt);

        if the number of elements in DataSeq > 1000 then
        begin
            Data = character-codes-to-text(DataSeq);
            call g2-java-example-send-over-socket-connection-channels-method (Socket, Data);
            DataSeq = sequence ();
        end;
    end;

    {send the last few bytes also}
    if the number of elements in DataSeq > 0 then
    begin
        Data = character-codes-to-text(DataSeq);
        call g2-java-example-send-over-socket-connection-channels-method (Socket, Data);
    end; 
    call g2-close-file(ReadFile);

End

g2-java-socket-manager-test-read-file(Socket: class g2-java-socket)

Begin

    repeat
        call g2-java-socket-read-it(Socket);
        exit if not(send-continuous);
       

        wait for 30 seconds;

    end;

    

End

_gsockdemo-startup (Object: class gfr-startup-object, InitialStartup: truth-value, Modules: class symbol-list, Client: class object)
 
  devstuffName: symbol = the symbol gdev-internals-workspaces; 
  Err: class error;

begin

  {--- No startup required for module restart }
{
  if not(InitialStartup) then return;
}
  {--- For devstuff development environment } 
  if the item named by devstuffName exists and GSOCKDEMO-TOP-LEVEL is not a member of the item-list named by devstuffName then
    insert GSOCKDEMO-TOP-LEVEL at the end of the item-list named by devstuffName;

  if the item named by devstuffName does not exist then
    show GSOCKDEMO-TOP-LEVEL at full scale at the center of the screen; 

end on error (Err)
  call gerr-dispatch (Err, this procedure, gfr-default-window);
end
